import React, { useState } from "react";
import { Button } from "@mui/material";
import Tooltip from "@mui/material/Tooltip";
import IconButton from "@mui/material/IconButton";
import WMSMap from "../../../map/WMSMap";

function SelectPerimeter({ setWizardStep, setStep, wizardStep, ...props }) {
    const [selectedValue, setSelectedValue] = useState("gothenburg");

    const handleBack = () => {
        setWizardStep(wizardStep - 1);
    };

    const handleNext = () => {
        setWizardStep(wizardStep + 1);
    };

    return (
        <div className={styles.selectPerimeterContainer}>
            <div className={styles.titleWrapper}>
                <div className={styles.title}>CREATE</div>
                <span className={styles.description}>
                    Embedding advanced urban material stock methods within governance
                    processes to enable circular economy and cities resilience
                </span>
            </div>
            <div>
                <div>Choose the perimeter you wish to continue with</div>
                <div className={styles.mapWrapper}>
                    <WMSMap />
                </div>
                <div className={styles.buttonsWrapper}>
                    <Tooltip title="Back" placement="top">
                        <IconButton onClick={handleBack}>
                            <i className="fas fa-chevron-left" />
                        </IconButton>
                    </Tooltip>
                    <Button variant="contained" onClick={handleNext}>
                        Next
                    </Button>
                </div>
            </div>
        </div>
    );
}
